pub enum RunError {

    /// Error in cargo manifests
    Manifest(String),

    /// Cargo failed to run
    Cargo(String),

    /// Error trying to resolve package configuration in manifest
    Packages(String),

    /// Tests failed to compile
    TestCompile(String),

    /// Test failed during run
    TestRuntime(String),
    TestFailed,

    /// Failed to parse
    Parse(std::io::Error),

    /// Failed to get test coverage
    TestCoverage(String),
    Trace(String),
    CovReport(String),
    OutFormat(String),
    IO(std::io::Error),
    StateMachine(String),
    NixError(nix::Error),
    Html(String),
    XML(cobertura::Error),
    Lcov(String),
    Json(String),
    Internal,

    /// Tuple of actual coverage and threshold
    BelowThreshold(f64, f64),
}

pub enum Event {
    ConfigLaunch(String),
    BinaryLaunch(TestBinary),
    Trace(TraceEvent),
}

pub enum Lines {

    /// Ignore all lines in the file
    All,

    /// A single line to ignore in the file
    Line(usize),
}

pub enum TracerAction<T> {

    /// Try continue is for times when you don't know if there is something
    /// paused but if there is you want it to move on.
    TryContinue(T),
    Continue(T),
    Step(T),
    Detach(T),
    Nothing,
}

pub enum LineType {

    /// Generated test main. Shouldn't be traced.
    TestMain,

    /// Entry of function known to be a test
    TestEntry(u64),

    /// Entry of function. May or may not be test
    FunctionEntry(u64),

    /// Standard statement
    Statement,

    /// Condition
    Condition,

    /// Unknown type
    Unknown,

    /// Unused meta-code
    UnusedGeneric,
}

pub enum CoverageStat {

    /// Line coverage data (whether line has been hit)
    Line(u64),

    /// Branch coverage data (whether branch has been true and false
    Branch(LogicState),

    /// Condition coverage data (each boolean subcondition true and false)
    Condition(Vec<LogicState>),
}
